import React from "react";
import { Link } from "react-router-dom";
import Navlogged from "./Navlogged";
import Navnolog from "./Navnolog";

function Navbar(props) {
  if (props.hi) {
    return <Navlogged />;
  } else {
    return <Navnolog />;
  }
}

export default Navbar;
